import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 63.2-1216 Final order not subject to attack after six months.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-1216.md","filePath":"vacode/63.2-1216.md"}'),o={name:"vacode/63.2-1216.md"},n=r('<h1 id="§-63-2-1216-final-order-not-subject-to-attack-after-six-months" tabindex="-1">§ 63.2-1216 Final order not subject to attack after six months. <a class="header-anchor" href="#§-63-2-1216-final-order-not-subject-to-attack-after-six-months" aria-label="Permalink to &quot;§ 63.2-1216 Final order not subject to attack after six months.&quot;">​</a></h1><p>After the expiration of six months from the date of entry of any final order of adoption from which no appeal has been taken to the Court of Appeals, the validity thereof shall not be subject to attack in any proceedings, collateral or direct, for any reason, including but not limited to fraud, duress, failure to give any required notice, failure of any procedural requirement, or lack of jurisdiction over any person, and such order shall be final for all purposes.</p><p>Code 1950, § 63-361; 1954, c. 489; 1968, c. 578, § 63.1-237; 1984, c. 703; 1995, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0772" target="_blank" rel="noreferrer">772</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0826" target="_blank" rel="noreferrer">826</a>; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0830" target="_blank" rel="noreferrer">830</a>, § 63.1-219.23; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>.</p>',3),i=[n];function l(s,c,f,d,h,p){return t(),a("div",null,i)}const g=e(o,[["render",l]]);export{u as __pageData,g as default};
